window.bookSummaryJSON = "<p><b>Bailey-Rose once believed she would forever be alone, packless, and seen as brokenâ€¦ but all that's changed.</b></p> <p>Randall, Bailey-Rose's ex-boyfriend, tries to steal her away but only ends up sending her to the hospital in need of life-saving surgery. While the situation was dire, the outcome has given Bailey-Rose a second chance to grab life by the horns and experience what it truly means to be an Omega.</p> <p>Her new lease on life is bittersweet as Randall is still eluding police, leaving her on edge. In an effort to keep their Omega safe and spend some well-deserved time together, after Bailey-Rose's recovery, her Alphas decided it was time to get out of town. Together, they grow and learn how to be the family each of them needs, healing old wounds and experiencing a love that will last for the ages.</p>"; 
